  name: Current
  nameWithType: SortedDictionary<TKey,TValue>.Enumerator.Current
  fullName: SortedDictionary<TKey,TValue>.Enumerator.Current
  type: Property
  assemblies:
  - System.Collections
  - System
  - netstandard
  namespace: System.Collections.Generic
  summary: Gets the element at the current position of the enumerator.
  remarks: "The <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.Current%2A> property is undefined under any of the following conditions:  \n  \n-   The enumerator is positioned before the first element in the dictionary, immediately after the enumerator is created. The <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.MoveNext%2A> method must be called to advance the enumerator to the first element of the collection before reading the value of <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.Current%2A>.  \n  \n-   The last call to <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.MoveNext%2A> returned `false`, which indicates the end of the collection.  \n  \n The <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.Current%2A> property returns the same object until <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.MoveNext%2A> is called. <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.MoveNext%2A> sets <xref:System.Collections.Generic.SortedDictionary%602.Enumerator.Current%2A> to the next element. If the collection is modified between <xref:System.Collections.IEnumerator.MoveNext%2A> and <xref:System.Collections.IEnumerator.Current%2A>, <xref:System.Collections.IEnumerator.Current%2A> returns the element that it is set to, even though the enumerator is invalidated.  \n  \n> [!NOTE]\n>  For better performance, this property does not throw an exception if the enumerator is positioned before the first element or after the last element. Instead, the value of the property is undefined."
  syntax:
    content: public System.Collections.Generic.KeyValuePair<TKey,TValue> Current { get; }
    return:
      type: System.Collections.Generic.KeyValuePair`2
      description: The element in the <xref href="System.Collections.Generic.SortedDictionary`2"></xref> at the current position of the enumerator.
